@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix(http://www.baidu.com/), url-prefix(http://news.baidu.com/), url-prefix(http://tieba.baidu.com/), url-prefix(http://zhidao.baidu.com/), url-prefix(http://mp3.baidu.com/), url-prefix(http://image.baidu.com/), url-prefix(http://baike.baidu.com/), url-prefix(http://video.baidu.com/), url-prefix(http://dict.baidu.com/) {
	
     body {
	    background: #253960 url("data:image/png;base64,") top left repeat-x !important;
	   color: #fff !important;
}
	.f{width:45em !important;}
img[src$="logo-yy.gif"],img[src$="mp3-jg.gif"],img[src$="sslm1_logo.gif"],img[src$="post-jg.gif"],img[src$="logo-news.gif"],img[src$="logo-zhidao.gif"],img[src$="img-jg.gif"],img[src$="shipin-jg.gif"],img[src$='logo-baike.gif']{width: 0 !important ;
		height: 46px !important;
		padding-left: 161px !important;
		background-image: url("data:image/png;base64,") !important;
        }
	img[src$="logo.gif"],img[src$="logo-mp3.gif"],img[src$="logo-shipin.gif"],img[src$="logo-img.gif"],img[src$="logo-dite.gif"]{width: 0 !important ;
         height:100px !important;
		padding-left: 280px !important;
		background:url("data:image/png;base64,") !important;
	}
	a:link, a:visited, .link,.span1 { color: #82BDFF !important; }
    a:active, .link:active { color: #92CDFF !important; }
	
	/*Results Page*/
    table[class="bi"],#nav,table[class="bi1"]{
         background: #405882 url("data:image/gif;base64,R0lGODlhAQAKAJEAAFBmjVRqkGd9oQAAACH5BAAAAAAALAAAAAABAAoAAAIEhIAJUQA7") top left repeat-x !important;
     }
    div[style="background-color: rgb(239, 242, 250); height: 60px; width: 100%; clear: both;"],#relsearch{ background: #405882 url("data:image/gif;base64,R0lGODlhAQAKAJEAAFBmjVRqkGd9oQAAACH5BAAAAAAALAAAAAABAAoAAAIEhIAJUQA7") top left repeat-x !important;border: none !important;height:100px !important;}
    font[color="#c60a00"]{font-weight: bold !important;color:yellow !important }
    font[color="#008000"]{color:#33DE76 !important}
    font[color="#261cdc"]{color:#FF2E3E !important}
    #kw,#ww,#wd1,#ikword,input[name="word"],input[name="wd"]{background:#94A8FC !important;border:1px solid #D7E2E8 !important;/*color:yellow !important;*/font-weight:bold !important }
    #ww{width:360px !important}
	
	/*AD on Left of results page*/
	table[width="25%"][align="right"],#rightAd{display:none !important;}
	
	/*News*/
        #nav a,p[class="more"] a{color:#DAFF05 !important}
	table[class="layout"] td[width="30%"] div[class="box1"],dl dt{background:#12305C !important}
    table[class="layout"] td[width="30%"] div[class="tbar"]{background:#405882 !important}
        dl dd{background:#253960 !important;}
       #hotwords dd,.aside dd{padding-bottom:30px !important;}
	
	/*zhidao*/
        #sub {border:#000 !important}
	#sub a{background:#405882 !important;}
	#sub span{background:#2E7FB5 !important;}
        #sub span[class="tba1"],#sub span[class="tba3"],#sub span[class="tbb2"]{height:10px !important;background:transparent !important;}
	#subline {top:25px !important;background:#bbb !important}
	#center div[class="p10"]{background:#405882 !important}
    .rg1, .rg2, .rg3, .rg4, .ry1, .ry2, .ry3, .ry4, .lj1, .rj1, .tjl, .tjr, .rba1, .rba2, .rba3, .rba4,.rk1,.rk2,.rk3,.rk4,.rya1,.rya2,.rcw1,.rcw2,.rcw3,.rcw4,.rg1,.rg2,.rga1,.rga2,.rga3,.rga4{background:none !important}
        div[class="t1"],div[class="tl"] ,#center_inner div[class='bc']{background:#405882 none !important}
        div[class="mod"] {background:none !important}
     #left .lj{background:none #9BC9DF !important;height:2px !important}
     #left div[class="bk"], #right div[class="bc2 mb10"],#right div[style="width: 100%; text-align: center;"],.bt,#objdir,#left div[class="bb"],#right .bc1,#center .bc,#right2 div[class="bc3 gray"],#center2 div[class="bc0"],#Tbs,table[class="dBlue"],div[style="background-color: white; z-index: 10; position: relative; width: 75% ! important;"],#content_inner div[class="bc0"],#right div[class="bc0"],#hot,#main div[class="nav"],.ph div,#itemsList table,#right2 div[class="ry"] div[class="bc0"],#center_inner div[class='bc'],#aside div[class='bc0'] {background:#12305C !important}
     #left .bc3,#masterbox,#masterbox div[class="bc4 agry"],#right div[class='bc4']{background:#12305C !important;color:#fff !important}
     #right .b2, #center .bg, #center .bba,#center .rgg,.rgg_1 {background:transparent !important;}
     #right #t1,#right #t2,.BlueBG{background:#2E7FB5 !important}
     #center_inner div[class="t2 mb10"],#center_inner div[class="t3 mb10"],#right div[class="t2"]{background:#405882 !important}
     #center2 div[class="t2"],#allNewTitle{background:none #405882 !important}
     span[class="f12 gray"]{color:#fff !important}
     #objdir div[class="info"]{color:#FCAF28 !important}
     
    /*baike*/
    span[class='fB']{color:#fff !important}
    td[class='titbg'][nowrap='nowrap'],td[class='tit2bg'][nowrap='nowrap'],span[class='t1'],div[class='t3'],div[class='ref dict']{background:#405882 !important}
     
     /*baidu pic*/
     #imgid,#tdLeft h2,h2 span,.span2,#DivCont{background:none #12305C !important;}
     #Tbs {color:#fff !important;}
     #Tbs th,.ntb,table[bgcolor="#0000cc"],tr[bgcolor="#d9e1f7"],table[style="margin-top: 15px; background-color: rgb(238, 238, 238);"],div[class="bgactive"],#newsTable,.ud,a[style="border: 1px solid rgb(122, 169, 223); padding: 5px 10px ! important; height: 1px; background-color: rgb(234, 243, 252); font-size: 12px;"],.BG3,.titbar,table[id="rightarea"] {background:#405882 !important;}
     .BG3{background:#405850 !important;}
     .l{border-left:#405882 10px solid !important;}
     #Tbs td{border-bottom-color:#405882 !important;}
     #tbl tr[bgcolor="#eeeeee"],table[id="tbl"][bgcolor="#ffffff"],.titlg,tr[bgcolor="#eeeeee"],tr[bgcolor="#f3f3f3"],table[bgcolor="#f3f3f3"]{background:#253960 !important;}
     #tbl tr[bgcolor="#ffffff"],table[bgcolor="#ffffff"][width="72%"],tr[bgcolor="#e5ecf9"],td[bgcolor="#e5ecf9"],#ft,tr[bgcolor="#ffffff"]{background:#12305C !important;}
     #tbl font[color="#000000"],font[color="#0000cc"],span[class="p2"],td[class="gray14"]{color:#D7E2E8 !important;}
     table[bgcolor="#ffffff"][height="20"]{background:transparent !important;}

     
        
}
